    public void BindGrid(GridView grdname, string query)
    {
        DataTable dt = gl.readdatafromcloud(query);
        grdname.DataSource = dt;
        grdname.DataBind();
    }

    public void BindGridAB(GridView grdname, string query)
    {
        DataTable dt = gl.readdatafromcloudAB(query);
        grdname.DataSource = dt;
        grdname.DataBind();
    }




    public DataTable ReturnDtAPI(string qry)
    {
        string data = DtConvert.ReadDataFROMCloud(qry);
        IList<Testbind> UserList = JsonConvert.DeserializeObject<IList<Testbind>>(data);
        DataTable dt = DtConvert.ToDataTable(UserList);
        return dt;
    }

